function CallGetDetails(){var n=GetSearchParam();HttpPost(`/ApprovalProcess/GetDetails`,"html",n,function(n){$("#LoadReportView").html("");$("#LoadReportView").html(n)})}function GetSearchParam(){return{userid:1}}function GetApprovalProccessList(n){var t=n;HttpGet(`/ApprovalProcess/GetApprovalProcessDetails/?processguid=${t}`,"json",function(n){n!=null?window.open(n,"newwindow"):WarningMessage("Unable to process request, Please contact to system administrator")})}$(document).ready(function(){CallGetDetails()});$("#btnId").click(function(){var n=$(this).val();$("#ddlModuleWise").val(n).trigger("change")});